import { Formik, Form, Field } from 'formik';
import { StyledForm } from './PhonebookForm.styled';
import { Wrapper } from './PhonebookForm.styled';
import { Title } from './PhonebookForm.styled';
import { Label } from './PhonebookForm.styled';

export const PhonebookForm = () => {
  return (
    <Wrapper>
      <Title>Phonebook</Title>
      <Formik
        initialValues={{ contacts: [], name: '', number: '' }}
        onSubmit={values => {
          console.log(values);
        }}
      >
        <StyledForm>
          <Label>
            Name
            <Field type="text" name="name" placeholder="Name" required />
          </Label>
          <Label>
            Number
            <Field type="tel" name="number" placeholder="number" required />
          </Label>
          <button type="submit">Add number</button>
        </StyledForm>
      </Formik>
    </Wrapper>
  );
};
